import React from 'react';

const Asteroid = ({ position }) => {
    const style = {
        position: 'absolute',
        left: position.x,
        top: position.y,
        width: '50px',
        height: '50px',
        backgroundColor: 'gray',
        borderRadius: '50%',
    };

    return <div style={style} />;
};

export default Asteroid;
